import { Grid, Stack } from "@mui/material";

export default function Header(){
    return(
        <Grid>
            <div>
            <Stack
                spacing={2}
                direction="row"
                style={{ display: "flex", justifyContent: "space-between" }}
            >
                <Button variant="text"><HomeRoundedIcon />Teja</Button>
                <Button variant="text">
                    Ere <ArrowDropDownIcon />{" "}
                </Button>
                <Button variant="text">
                    Listings <ArrowDropDownIcon />{" "}
                </Button>
                <Button variant="text">
                    Members <ArrowDropDownIcon />{" "}
                </Button>
                <Button variant="text">
                    Blog <ArrowDropDownIcon />{" "}
                </Button>
                <Button variant="text">
                    Pages <ArrowDropDownIcon />{" "}
                </Button>
                <Button variant="text">
                    {" "}
                    <AccountCircleIcon /> Login/Register
                </Button>
                <Button variant="outlined">
                    Add Property <ArrowOutwardIcon />{" "}
                </Button>
                <DragHandleIcon />
            </Stack>
            </div>
        </Grid>
    )
}
